css:
.structure {
background-image: url("https://images.surferseo.art/87c3d1dd-185a-42d1-8c90-f7645ef18a52.jpeg")
}
.dash-letter.is-typed {
  opacity: 0.01; }

.dash-letter.is-correct {
  color: #2E3141; }

.dash-letter.is-incorrect {
  background: #D62F3A;
  color: #fff; }

.dash-letter.is-waiting {
  background: #2f988c;
  color: black;
}
.btn--primary, .season--xmaxx-2022 .header > .header-core .header-login {
    background: #551e98;
    color: white;
}
.dash-side {
    width: 185px;
    flex: 1 0 185px;
    position: relative;
}
.card--b {
    background-color: #2f1b759e;
    color: #fff;
}
.dash-copyContainer {
    background: linear-gradient(to bottom, rgb(49 33 100 / 90) 65, rgb(68 22 103 / 87) 70, #181a58 100);
    border-radius: 5px;
    box-shadow: 0 1px 10px rgba(2, 2, 2, 0.14);
    flex: 1;
    overflow: hidden;
    padding: 15px;
    width: 654px;
    display: flex;
}
